import React from 'react';
import { useNavigate } from 'react-router-dom';
import backgroundImage from './components/background.png';
import './EmployeePage.css';

const EmployeePage = () => {
  const navigate = useNavigate();

  const handleButtonClick = () => {
    // Действие по нажатию на кнопку "На всякий случай"
    alert("Кнопка 'На всякий случай' нажата!");
  };

  return (
    <div className="employee-container" style={{ backgroundImage: `url(${backgroundImage})` }}>
      <h1 className="employee-title">Страница для сотрудника</h1>
      {/* Используем тот же класс, что и в главном меню */}
      <button className="mainmenu-btn" onClick={handleButtonClick}>
        На всякий случай
      </button>
    </div>
  );
};

export default EmployeePage;
